import React from "react";
import "./style.css";

function FriendsCard(props) {
  return (
    <div className="card">
      <div className="img-container">
        <img alt={props.name} src={props.image} />
      </div>
      <span onClick={() => props.reOrderFriend(props.id)} className="reOrder">
      {props.image}
      </span>
    </div>
  );
}

export default FriendsCard;
